import React, {useEffect} from "react";
import "../styles/Modal.css"

function useItems(){
    const [items, setItems] = React.useState(  [])


    useEffect(() => {
        fetch("http://localhost:8080/prometheus/fxspot/getAll")
            .then(response => response.json())
            .then(data => setItems(data)).then(data => console.log(data));
    }, []);

    const listItems = items.map((d) => <ul><li className="itemsLi" key={d.id}>{d.id}</li>
        <li className="itemsLi" key={d.name}>{d.name}</li>
        <li className="itemsLi" key={d.spotRate }>{d.spotRate }</li>
    </ul>);
    return listItems
}


export default class Modal extends React.Component {
    state = {
        isOpen: false
    }


    render() {
        return (
            <React.Fragment>
                <button onClick={() => this.setState({isOpen: true})}> Модальное окно
                </button>

                {this.state.isOpen && <div className= "modal">
                    <div className= "modal-body">
                        <p>Список </p>
                        <ul> <li>{console.log(useItems)}</li><li>2</li></ul>


                        <button onClick={() => this.setState({isOpen: false})}> Закрыть</button>
                    </div>
                </div>}
            </React.Fragment>
        )
    }
}
